import org.junit.Test

class PermutationsTest {
  @Test void testPermutations() {
    ['abc', 'bac', 'bca', 'acb', 'cab', 'cba'] == Permutations.permutations('abc')
    println Permutations.permutations('abcd').size()
    print Permutations.permutations('abcd').join('\n')
  }
  @Test void longestPermutations() {
    assert '1 2 3' == Permutations.longestIncreasingSeq('5 1 4 2 3')
    assert '5 4 2' == Permutations.longestDecreasingSeq('5 1 4 2 3')

    assert LONGEST_INCREASING_SEQ.longestEcreasingSeq == Permutations.longestIncreasingSeq(LONGEST_INCREASING_SEQ.seq)
    assert LONGEST_INCREASING_SEQ.longestDecreasingSeq == Permutations.longestDecreasingSeq(LONGEST_INCREASING_SEQ.seq)

  }

